import React from 'react';
import styled from 'styled-components';
import SentimentVeryDissatisfiedIcon from '@mui/icons-material/SentimentVeryDissatisfied';
import SentimentDissatisfiedIcon from '@mui/icons-material/SentimentDissatisfied';
import SentimentNeutralIcon from '@mui/icons-material/SentimentNeutral';
import SentimentSatisfiedIcon from '@mui/icons-material/SentimentSatisfied';
import SentimentVerySatisfiedIcon from '@mui/icons-material/SentimentVerySatisfied';

const DiaryBackground = styled.div`
    width: 100%;
    min-height: 90vh;
    background-color: #efefef;
    margin-top: 4rem;
`;

const DiaryContainer = styled.div`
    width: 85%;
    height: 50vh;
    margin: 2rem auto;
    background-color: white;
    border-radius: 10px;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    align-items: center;
`
const DiaryDiv = styled.div`
    width: 85%;
    height: 85%;
    margin: 2rem;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    align-items: center;
`

const DiaryContext1 = styled.p`
    font-size: 1.2rem;
    color: gray;
    text-align: center;
`

const DiaryContext2 = styled.p`
    font-size: 2rem;
    color: black;
    font-weight: bold;
    text-align: center;
    margin: 0 0 2rem 0;
`

const FeelDiv = styled.div`
    width: 100%;
    height: 50%;
    display: flex;
    justify-content: center;
    align-items: center;
`

const FeelDissati = styled.div`
    margin: 0.5rem;
    width: 25%;
    height: 90%;
    background-color: red;
    border-radius: 10px;
    display: flex;
    justify-content: center;
    align-items: center;
`

const FeelBad = styled.div`
    margin: 0.5rem;
    width: 25%;
    height: 90%;
    background-color: orange;
    border-radius: 10px;
    display: flex;
    justify-content: center;
    align-items: center;
`

const FeelSoso = styled.div`
    margin: 0.5rem;
    width: 25%;
    height: 90%;
    background-color: yellow;
    border-radius: 10px;
    display: flex;
    justify-content: center;
    align-items: center;
`

const FeelGood = styled.div`
    margin: 0.5rem;
    width: 25%;
    height: 90%;
    background-color: lightgreen;
    border-radius: 10px;
    display: flex;
    justify-content: center;
    align-items: center;
`

const FeelHappy = styled.div`
    margin: 0.5rem;
    width: 25%;
    height: 90%;
    background-color: lightblue;
    border-radius: 10px;
    display: flex;
    justify-content: center;
    align-items: center;
`

export const MyDiary = () => {
    return (
        <DiaryBackground>
            <DiaryContainer>
                <DiaryDiv>
                    <DiaryContext1>
                        안녕하세요 서준님,
                    </DiaryContext1>
                    <DiaryContext2>
                        오늘의 하루는<br/> 어떠셨나요?
                    </DiaryContext2>
                    <FeelDiv>
                        <FeelDissati>
                            <SentimentVeryDissatisfiedIcon style={{
                                width: '100%', height: '50%', marginTop: '0.5rem'
                            }}/>
                        </FeelDissati>
                        <FeelBad>
                            <SentimentDissatisfiedIcon style={{
                                width: '100%', height: '50%', marginTop: '0.5rem'
                            }}/>
                        </FeelBad>
                        <FeelSoso>
                            <SentimentNeutralIcon style={{
                                width: '100%', height: '50%', marginTop: '0.5rem'
                            }}/>
                        </FeelSoso>
                        <FeelGood>
                            <SentimentSatisfiedIcon style={{
                                width: '100%', height: '50%', marginTop: '0.5rem'
                            }}/>
                        </FeelGood>
                        <FeelHappy>
                            <SentimentVerySatisfiedIcon style={{
                                width: '100%', height: '50%', marginTop: '0.5rem'
                            }}/>
                        </FeelHappy>
                    </FeelDiv>
                </DiaryDiv>
            </DiaryContainer>
        </DiaryBackground>
    );
};

export default MyDiary;
